"""
Given a string, find the length of the longest substring without repeating characters.

Hash is used to store the key value pair (unique string, index)

"""
def find_longest_uniquestr(input_str):
    if len(input_str) == 0:
        return None
    elif len(input_str) == 1:
        return input_str
    else:
        # initilaize the hash table {index:unique_char}
        h = {}
        max_length_seen_sofar = 0
        index = 0
        max = 0
        start, end = 0, 0

        while index < len(input_str):
            if h.get(input_str[index]) == None:
                h[input_str[index]]= index
                end += 1
                index += 1

            else:
                max = len(h) if max < len(h) else max
                # found a duplicate! Get the duplicate characters index and delete all the characters before it
                get_duplicate_charidx = h.get(input_str[index])
                temp = get_duplicate_charidx

                # get the dupliacte index and check if the elements before it exists in the hash

                while get_duplicate_charidx >= start:
                    del h[input_str[get_duplicate_charidx]]
                    get_duplicate_charidx -= 1

                h[input_str[index]] = index
                index += 1
                start = temp + 1
                end = start if start >= end else end

        return max if len(h) < max else len(h)




